import React,{useState} from "react";
import {Button, Container, Navbar} from "react-bootstrap"
import Products from "./Components/Products";


const App=()=>{

  const [ShowCart,setShowCart]=useState(false)

  const StateChangeHandler=()=>{
    setShowCart(true)
  }
  return(
    <>
      <Navbar bg="dark" expand="sm" variant="dark" className="mb-1">
        <Container>
          <Navbar.Brand href="\">Home</Navbar.Brand>
          <Navbar.Brand href="\">Store</Navbar.Brand>
          <Navbar.Brand href="\">About</Navbar.Brand>
          <Button variant="dark" onClick={StateChangeHandler} style={{borderColor: "blue"}}>Cart</Button>
        </Container>
      </Navbar>
      <Navbar bg="secondary" expand="lg" variant="dark" className="mb-3">
        <Container style={{textAlign: "center"}}>
          <Navbar.Brand >The Generics</Navbar.Brand>
        </Container>
      </Navbar>
      <p style={{fontFamily: "cursive", fontSize: "50px", textAlign: "center"}}>Music</p>
      <Products />
    </>
  )
}

export default App
